<?phpnamespace Nemundo\WebLog\Data\UrlLog;use Nemundo\Model\Data\AbstractModelUpdate;class UrlLogUpdate extends AbstractModelUpdate {/*** @var UrlLogModel*/public $model;/*** @var string*/public $url;/*** @var int*/public $visitor;/*** @var string*/public $pageTitle;public function __construct() {parent::__construct();$this->model = new UrlLogModel();}public function update() {$this->typeValueList->setModelValue($this->model->url, $this->url);$this->typeValueList->setModelValue($this->model->visitor, $this->visitor);$this->typeValueList->setModelValue($this->model->pageTitle, $this->pageTitle);parent::update();}}